import { useState } from "react";
import { Container, Row, Col, Tab, Nav, Modal, Button } from "react-bootstrap";
import { ProjectCard } from "./ProjectCard";
import greencircle from "../assets/img/greencircle.png";
import semantix from "../assets/img/semantix.png";
import unesco from "../assets/img/newunesco.png";
import backpack from "../assets/img/newback2.png";
import darty from "../assets/img/darty.png";
import java from '../assets/img/java.svg';
import c from '../assets/img/c.png';
import css from '../assets/img/css.png';
import html from '../assets/img/html.webp';
import js from '../assets/img/js.webp';
import php from '../assets/img/php.webp';
import python from '../assets/img/python.png';
import sql from '../assets/img/sql.png';
import colorSharp2 from "../assets/img/color-sharp2.png";
import 'animate.css';
import TrackVisibility from 'react-on-screen';

export const Projects = () => {
  const [showModal, setShowModal] = useState(false);
  const [modalContent, setModalContent] = useState({});

  const projects = [
    {
      title: "Green Circle",
      description: "Développement web",
      imgUrl: greencircle,
      modalText: "Site web permettant aux entreprises du Val d'Europe de participer à l'économie circulaire...",
      icons: [js, sql, python] // Icônes pour ce projet
    },
    {
      title: "Semantix",
      description: "Développement d'application",
      imgUrl: semantix,
      modalText: "Le principe de ce jeu est simple...",
      icons: [<FaGithub />, <FaExternalLinkAlt />] // Icônes pour ce projet
    },
    {
      title: "UNESCO",
      description: "Développement web",
      imgUrl: unesco,
      modalText: "Ce projet est un site web interactif pour l'UNESCO...",
      icons: [<FaLinkedin />, <FaExternalLinkAlt />] // Icônes pour ce projet
    },
    {
      title: "Backpack Hero",
      description: "Développement d'application",
      imgUrl: backpack,
      modalText: "Le jeu se déroule dans un donjon...",
      icons: [<FaGithub />, <FaLinkedin />] // Icônes pour ce projet
    },
  ];

  const pro = [
    {
      title: "Site web Darty.com",
      description: "Développement web",
      imgUrl: darty,
      modalText: "Assistant développeur Java en alternance chez Fnac darty...",
      icons: [<FaGithub />] // Icônes pour ce projet
    },
  ];

  const handleShow = (project) => {
    setModalContent(project); 
    setShowModal(true); 
  };

  const handleClose = () => setShowModal(false);

  return (
    <section className="project" id="projects">
      <Container>
        <Row>
          <Col size={12}>
            <TrackVisibility>
              {({ isVisible }) =>
              <div className={isVisible ? "animate__animated animate__fadeIn": ""}>
                <h2>Projets</h2>
                <br></br>
                <Tab.Container id="projects-tabs" defaultActiveKey="first">
                  <Nav variant="pills" className="nav-pills mb-5 justify-content-center align-items-center" id="pills-tab">
                    <Nav.Item>
                      <Nav.Link eventKey="first">Académique</Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                      <Nav.Link eventKey="second">Professionnel</Nav.Link>
                    </Nav.Item>
                  </Nav>
                  <Tab.Content id="slideInUp" className={isVisible ? "animate__animated animate__slideInUp" : ""}>
                    <Tab.Pane eventKey="first">
                      <Row>
                        {projects.map((project, index) => (
                          <ProjectCard
                            key={index}
                            {...project}
                            handleClick={() => handleShow(project)} 
                          />
                        ))}
                      </Row>
                    </Tab.Pane>
                    <Tab.Pane eventKey="second">
                      <Row>
                        {pro.map((project, index) => (
                          <ProjectCard
                            key={index}
                            {...project}
                            handleClick={() => handleShow(project)} 
                          />
                        ))}
                      </Row>
                    </Tab.Pane>
                  </Tab.Content>
                </Tab.Container>
              </div>}
            </TrackVisibility>
          </Col>
        </Row>
      </Container>

      {/* Modale */}
      <Modal show={showModal} onHide={handleClose}>
        <Modal.Header closeButton>
          <Modal.Title>{modalContent.title}</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <p>{modalContent.modalText}</p>
          <div className="icon-container">
            {modalContent.icons && modalContent.icons.map((icon, index) => (
              <span key={index} className="icon">{icon}</span>
            ))}
          </div>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleClose}>
            Fermer
          </Button>
        </Modal.Footer>
      </Modal>

      <img className="background-image-right" src={colorSharp2} alt="background" />
    </section>
  );
};
